import React from 'react';
import './App.css';
import Person from './Person/Person';

function App() {


  return (
    <div className="App">
        <Person name="sven_1" age="32" />
        <Person name="sven_2" age="33">My Hobbies are: drumming and programming</Person>
        <Person name="sven_3" age="34" />
    </div>
  );
}

export default App;
